class Builder extends Component {
  render() {
    return (
      <div className="App">
        <div id="toolbar">
          <span className="toolbarItem">
            + Add Menu
            </span>|
            <span className="toolbarItem">
            + Add Item
            </span>
        </div>
        <div id="content">
          <div id="menus">
            <div className="menu">
              <h3>menu title</h3>
            </div>
            <div className="menu"><h3>menu title</h3></div>
            <div className="menu">
              <h3>menu title</h3>
            </div>
          </div>
        </div>
      </div >
    )
  };
}

export default Builder;
